import { NavLink } from "react-router-dom"
import styled from "styled-components";

const NavUnlisted = styled.ul`

  display: flex;
  // padding: 0;
  justify-content: left;
  align-items: center;
  column-gap: 35px;

  li {
    font-size: 1.3rem;
    // position: relative;
    // list-style: none;
  }
`;

const Header = () => {
    return (
        <header className="bg-olive-green p-5 header">
            <NavUnlisted>
                    <NavLink to="/" 
                      // style={({ isActive}) => {return {fontWeight: isActive ? "bold" : "normal"}}}
                      className="visited:font-bold"
                      >
                      <li className="text-white">Home</li></NavLink>
                    <div className="border-l-[1px] vl"></div>
                    <NavLink to="/shops" 
                      style={({ isActive}) => {return {fontWeight: isActive ? "bold" : "normal"}}}>
                      <li className="text-white">Shops</li>
                    </NavLink>
                    <div className="border-l-[1px] vl"></div>
                    <NavLink to="cart"
                      style={({ isActive}) => {return {fontWeight: isActive ? "bold" : "normal"}}}>
                        <li className="text-white">Shopping Cart</li>
                    </NavLink>
                    <div className="border-l-[1px] vl"></div>
                    <NavLink to="history"
                      style={({ isActive}) => {return {fontWeight: isActive ? "bold" : "normal"}}}>
                      <li className="text-white">History</li>
                      </NavLink>
                    <div className="border-l-[1px] vl"></div>
                    <NavLink to="coupons"
                      style={({ isActive}) => {return {fontWeight: isActive ? "bold" : "normal"}}}>
                        <li className="text-white">Coupons</li>
                    </NavLink>
            </NavUnlisted>
          </header>
    )
}

export default Header
